import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

function createNote (note) {
    return(
        <Note 
                title = {note.title}
                content = {note.content}
            />
    );
}

function App () {
    return (
        <div>
            <Header />
            notes.map
            <Footer />
        </div>
    );
}

export default App;
